   "movie": "The Fellowship of the Ring "
 },
 {
   "id": 2283,
   "char": "RING",
   "dialog": "Baggins.... Baggins.... Baggins ....Baggins!  Baggins! ",
   "movie": "The Fellowship of the Ring "
 },
 {
   "id": 2284,
   "char": "PIPPIN",
   "dialog": "Baggins ?  Sure I know a Baggins!  He's over     there.  Frodo Baggins! He's my second cousin once removed on his     mother's side , and my     third cousin twice removed on his father's side, if you follow me.  ",
   "movie": "The Fellowship of the Ring "
 },
 {
   "id": 2285,
   "char": "FRODO",
   "dialog": "Pippin! ",
   "movie": "The Fellowship of the Ring "
 },
 {
   "id": 2286,
   "char": "PIPPIN",
   "dialog": "Steady on! ",
   "movie": "The Fellowship of the Ring "
 },
 {
   "id": 2287,
   "char": "MEN",
   "dialog": "Oh! ",
   "movie": "The Fellowship of the Ring "
 },
 {
   "id": 2288,
   "char": "SAURON VOICE",
   "dialog": "You cannot hide!  , I see you!    ,There     is no life in the void , Only death! ",
   "movie": "The Fellowship of the Ring "
 },
 {
   "id": 2289,
   "char": "STRIDER",
   "dialog": "You draw far too much attention to yourself Mr Underhill! ",
   "movie": "The Fellowship of the Ring "
 },
 {
   "id": 2290,
   "char": "FRODO",
   "dialog": "What do you want ? ",
   "movie": "The Fellowship of the Ring "
 },
 {
   "id": 2291,
   "char": "STRIDER",
   "dialog": "A little more caution from you!  That is no trinket     you carry! ",
   "movie": "The Fellowship of the Ring "
 },
 {
   "id": 2292,
   "char": "FRODO",
   "dialog": "I carry nothing ",
   "movie": "The Fellowship of the Ring "
 },
 {
   "id": 2293,
   "char": "STRIDER",
   "dialog": "Indeed , I can avoid being seen if I wish.      But to disappear entirely     That is a rare gift! ",
   "movie": "The Fellowship of the Ring "
 },
 {
   "id": 2294,
   "char": "BILBO",
   "dialog": "You've caught me a bit unprepared I'm afraid urm we've     only got cold chicken and a bit of pickle oh and there's some cheese here,     oh no that wont do! Urm we've got raspberry jam, an apple tart    ,     but we've not much for afters. Oh no we're all right, I've found some sponge     cake! , I can make     you some eggs if you ' oh'. Gandalf?        ",
   "movie": "The Fellowship of the Ring "
 },
 {
   "id": 2295,
   "char": "GANDALF",
   "dialog": "Just tea, thank you.       ",
   "movie": "The Fellowship of the Ring "
 },
 {
   "id": 2296,
   "char": "BILBO",
   "dialog": "Oh right. ,     You don't mind if I do, do you?  ",
   "movie": "The Fellowship of the Ring "
 },
 {
   "id": 2297,
   "char": "GANDALF",
   "dialog": "Oh not at all!       ",
   "movie": "The Fellowship of the Ring "
 },
 {
   "id": 2298,
   "char": "VOICE",
   "dialog": "Bilbo! Bilbo Baggins! ",
   "movie": "The Fellowship of the Ring "
 },
 {
   "id": 2299,
   "char": "BILBO",
   "dialog": " I'm not at     home! , It's the Sackville-Bagginses. ",
   "movie": "The Fellowship of the Ring "
 },
 {
   "id": 2300,
   "char": "VOICE",
   "dialog": "I know you're in there!       ",
   "movie": "The Fellowship of the Ring "
 },
 {
   "id": 2301,
   "char": "BILBO",
   "dialog": "They're after the house! , They've never forgiven me for living this     long. I've got to get away from these confounded relatives hanging on the     bell all day, never giving me a moment's peace. , I want to see     mountains again, mountains Gandalf. , And     then find somewhere quiet where I can finish my book. Oh, tea!     ",
   "movie": "The Fellowship of the Ring "
 },
 {
   "id": 2302,
   "char": "GANDALF",
   "dialog": "So you mean to go through with your plan then?       ",
   "movie": "The Fellowship of the Ring "
 },
 {
   "id": 2303,
   "char": "BILBO",
   "dialog": "Yes, yes, it's all in hand. All the arrangements are     made. , Oh, thank you.       ",
   "movie": "The Fellowship of the Ring "
 },
 {
   "id": 2304,
   "char": "GANDALF",
   "dialog": "Frodo suspects something.       ",
   "movie": "The Fellowship of the Ring "
 },
 {
   "id": 2305,
   "char": "BILBO",
   "dialog": "Of course he does, he's a Baggins, not some blockheaded     Bracegirdle from Hardbottle.        ",
   "movie": "The Fellowship of the Ring "
 },
 {
   "id": 2306,
   "char": "GANDALF",
   "dialog": "You will tell him wont you? ",
   "movie": "The Fellowship of the Ring "
 },
 {
   "id": 2307,
   "char": "MERRY",
   "dialog": " Pippin! ",
   "movie": "The Return of the King "
 },
 {
   "id": 2308,
   "char": "LEGOLAS",
   "dialog": "He is here! ",
   "movie": "The Return of the King "
 },
 {
   "id": 2309,
   "char": "SAURON",
   "dialog": "I see you! ",
   "movie": "The Return of the King "
 },
 {
   "id": 2310,
   "char": "MERRY",
   "dialog": "Pippin! ",
   "movie": "The Return of the King "
 },
 {
   "id": 2311,
   "char": "MERRY",
   "dialog": "Help! Gandalf help!  ",
   "movie": "The Return of the King "
 },
 {
   "id": 2312,
   "char": "MERRY",
   "dialog": "Help him! ",
   "movie": "The Return of the King "
 },
 {
   "id": 2313,
   "char": "MERRY",
   "dialog": " Pippin! ",
   "movie": "The Return of the King "
 },
 {
   "id": 2314,
   "char": "GANDALF",
   "dialog": "Fool of a Took!  ",
   "movie": "The Return of the King "
 },
 {
   "id": 2315,
   "char": "GANDALF",
   "dialog": "No. ",
   "movie": "The Return of the King "
 },
 {
   "id": 2316,
   "char": "GANDALF",
   "dialog": "Look at me.  ",
   "movie": "The Return of the King "
 },
 {
   "id": 2317,
   "char": "PIPPIN",
   "dialog": "Gandalf, forgive me! ",
   "movie": "The Return of the King "
 },
 {
   "id": 2318,
   "char": "GANDALF",
   "dialog": "Look at me! What did you see?  ",
   "movie": "The Return of the King "
 },
 {
   "id": 2319,
   "char": "PIPPIN",
   "dialog": "A tree, there was a white tree in a courtyard of stone. It was dead.    ,The city was burning. ",
   "movie": "The Return of the King "
 },
 {
   "id": 2320,
   "char": "GANDALF",
   "dialog": "Minas Tirith? Is that what you saw? ",
   "movie": "The Return of the King "
 },
 {
   "id": 2321,
   "char": "BOROMIR",
   "dialog": "They have a cave troll! ",
   "movie": "The Fellowship of the Ring "
 },
 {
   "id": 2322,
   "char": "GIMLI",
   "dialog": "Agh!  Let them come There's one dwarf yet in Moria who     still draws breath. ",
   "movie": "The Fellowship of the Ring "
 },
 {
   "id": 2323,
   "char": "ARAGORN",
   "dialog": "Pull! ",
   "movie": "The Fellowship of the Ring "
 },
 {
   "id": 2324,
   "char": "FRODO",
   "dialog": "Who are you ? ",
   "movie": "The Fellowship of the Ring "
 },
 {
   "id": 2325,
   "char": "STRIDER",
   "dialog": "Are you frightened? ",
   "movie": "The Fellowship of the Ring "
 },
 {
   "id": 2326,
   "char": "FRODO",
   "dialog": " Yes ",
   "movie": "The Fellowship of the Ring "
 },
 {
   "id": 2327,
   "char": "STRIDER",
   "dialog": "Not nearly frightened enough. I know what hunts you.  ",
   "movie": "The Fellowship of the Ring "
 },
 {
   "id": 2328,
   "char": "SAM",
   "dialog": "Let him     go!  Or I'll have you Longshanks! ",
   "movie": "The Fellowship of the Ring "
 },
 {
   "id": 2329,
   "char": "STRIDER",
   "dialog": " You have a     stout heart little hobbit! But that will not save you.  You can no     longer wait for the wizard Frodo. They're coming ",
   "movie": "The Fellowship of the Ring "
 },
 {
   "id": 2330,
   "char": "FRODO",
   "dialog": "What are they ? ",
   "movie": "The Fellowship of the Ring "
 },
 {
   "id": 2331,
   "char": "STRIDER",
   "dialog": "They were once men. Great Kings of Men.  The Sauron     the Deciever  gave to them nine rings of power. Blinded by their greed     they took them without question. One by one falling into darkness    ,Now they are slaves to his will. They are     the Nazg'l. Ringwraiths.  Neither living nor dead. At all times they     feel the presence of the Ring , Drawn to the power of the One    , They     will never stop hunting you. ",
   "movie": "The Fellowship of the Ring "
 },
 {
   "id": 2332,
   "char": "FRODO",
   "dialog": "Where are you taking us ? ",
   "movie": "The Fellowship of the Ring "
 },
 {
   "id": 2333,
   "char": "STRIDER",
   "dialog": "Into the wild ",
   "movie": "The Fellowship of the Ring "
 },
 {
   "id": 2334,
   "char": "MERRY",
   "dialog": " How do we know this Strider is a friend of Gandalf ?  ",
   "movie": "The Fellowship of the Ring "
 },
 {
   "id": 2335,
   "char": "FRODO",
   "dialog": "I think a servant of the enemy would look fairer, but feel     fouler. ",
   "movie": "The Fellowship of the Ring "
 },
 {
   "id": 2336,
   "char": "MERRY",
   "dialog": "He's foul enough  ",
   "movie": "The Fellowship of the Ring "
 },
 {
   "id": 2337,
   "char": "FRODO",
   "dialog": "We have no choice but to trust him ",
   "movie": "The Fellowship of the Ring "
 },
 {
   "id": 2338,
   "char": "BILBO",
   "dialog": "Yes, yes. ",
   "movie": "The Fellowship of the Ring "
 },
 {
   "id": 2339,
   "char": "GANDALF",
   "dialog": "He's very fond of you. ",
   "movie": "The Fellowship of the Ring "
 },
 {
   "id": 2340,
   "char": "BILBO",
   "dialog": "I know, he'd probably come with me if I asked him to. I     think in his heart Frodo's still in love with the Shire, the woods, the     fields and the little rivers. I am old Gandalf. I know I don't look it, but     I'm beginning to feel it in my heart. , I feel     thin, sort of stretched like butter scraped over too much bread. I need a     holiday, a very long holiday. And I don't expect that I shall return. In     fact, I mean not to.       ",
   "movie": "The Fellowship of the Ring "
 },
 {
   "id": 2341,
   "char": "BILBO",
   "dialog": "Old Toby, the finest weed in the Southfarthing. ",
   "movie": "The Fellowship of the Ring "
 },
 {
   "id": 2342,
   "char": "BILBO",
   "dialog": "Gandalf my old friend, this will be a night to     remember.       ",
   "movie": "The Fellowship of the Ring "
 },
 {
   "id": 2343,
   "char": "PIPPIN",
   "dialog": "I saw' I saw him! , I     could hear his voice in my head. ",
   "movie": "The Return of the King "
 },
 {
   "id": 2344,
   "char": "GANDALF",
   "dialog": "And what did you tell him? Speak! ",
   "movie": "The Return of the King "
 },
 {
   "id": 2345,
   "char": "PIPPIN",
   "dialog": "He asked me my name. I didn't answer. He hurt me! ",
   "movie": "The Return of the King "
 },
 {
   "id": 2346,
   "char": "GANDALF",
   "dialog": "What did you tell him about Frodo and the Ring?      ",
   "movie": "The Return of the King "
 },
 {
   "id": 2347,
   "char": "GANDALF",
   "dialog": "There was no lie in Pippin's eyes. A fool but an honest fool he remains.     ",
   "movie": "The Return of the King "
 },
 {
   "id": 2348,
   "char": "GANDALF",
   "dialog": "He told Sauron nothing of Frodo and the Ring. ,We've been strangely fortunate. Pippin saw in the Palantir a glimpse     of the enemy's plan. Sauron moves to strike the city of Minas Tirith.    ",
   "movie": "The Return of the King "
 },
 {
   "id": 2349,
   "char": "GAN DALF",
   "dialog": "His defeat at Helm's Deep showed our enemy one thing.    , He knows the Heir of     Elendil has come forth ,     Men are not as weak as he supposed. There is courage still. Strength enough,     perhaps, to challenge him. Sauron fears this. He will not risk the peoples     of Middle Earth uniting under one banner. , He will raze Minas Tirith to the ground    , before he     sees a King return to the throne of men. If the beacons of Gondor are lit     Rohan must be ready for war. ",
   "movie": "The Return of the King "
 },
 {
   "id": 2350,
   "char": "THEODEN",
   "dialog": "Tell me! Why should we ride to the aid of those who did not come to     ours? What do we owe Gondor? ",
   "movie": "The Return of the King "
 },
 {
   "id": 2351,
   "char": "ARAGORN",
   "dialog": "I will go! ",
   "movie": "The Return of the King "
 },
 {
   "id": 2352,
   "char": "GANDALF",
   "dialog": "No!  ",
   "movie": "The Return of the King "
 },
 {
   "id": 2353,
   "char": "ARAGORN",
   "dialog": "They must be warned! ",
   "movie": "The Return of the King "
 },
 {
   "id": 2354,
   "char": "SAM",
   "dialog": " But where     is he leading us ? ",
   "movie": "The Fellowship of the Ring "
 },
 {
   "id": 2355,
   "char": "STRIDER",
   "dialog": "To Rivendell Master Gamgee.  To the House of Elrond.     ",
   "movie": "The Fellowship of the Ring "
 },
 {
   "id": 2356,
   "char": "SAM",
   "dialog": "D'you hear that!  Rivendell! We're going to see the     elves! ",
   "movie": "The Fellowship of the Ring "
 },
 {
   "id": 2357,
   "char": "STRIDER",
   "dialog": "Gentlemen! We do not stop 'til nightfall ",
   "movie": "The Fellowship of the Ring "
 },
 {
   "id": 2358,
   "char": "PIPPIN",
   "dialog": "What about breakfast ? ",
   "movie": "The Fellowship of the Ring "
 },
 {
   "id": 2359,
   "char": "STRIDER",
   "dialog": " You've     already had it ",
   "movie": "The Fellowship of the Ring "
 },
 {
   "id": 2360,
   "char": "PIPPIN",
   "dialog": "We've had one yes.  What about second breakfast ? ",
   "movie": "The Fellowship of the Ring "
 },
 {
   "id": 2361,
   "char": "MERRY",
   "dialog": "Don't think he knows about second breakfast Pippin     ",
   "movie": "The Fellowship of the Ring "
 },
 {
   "id": 2362,
   "char": "PIPPIN",
   "dialog": "What about elvenses ? Luncheon, Afternoon Tea, Dinner ?     Supper!  He knows about them, doesnt he ? ",
   "movie": "The Fellowship of the Ring "
 },
 {
   "id": 2363,
   "char": "MERRY",
   "dialog": "I wouldn't count on it ",
   "movie": "The Fellowship of the Ring "
 },
 {
   "id": 2364,
   "char": "MERRY",
   "dialog": "Pippin! ",
   "movie": "The Fellowship of the Ring "
 },
 {
   "id": 2365,
   "char": "GANDALF",
   "dialog": "They will be. ,     You must come to Minas Tirith by another road. Follow the river. Look to the     black ships. ,     Understand this, things are now in motion that cannot be undone. I ride for     Minas Tirith , and I     wont be going alone. ",
   "movie": "The Return of the King "
 },
 {
   "id": 2366,
   "char": "GANDALF",
   "dialog": "Of all the Hobbits, Peregrin Took, you are the worst! Hurry! Hurry! ",
   "movie": "The Return of the King "
 },
 {
   "id": 2367,
   "char": "PIPPIN",
   "dialog": "Where are we going? ",
   "movie": "The Return of the King "
 },
 {
   "id": 2368,
   "char": "MERRY",
   "dialog": "Why did you look? Why do you always have to look? ",
   "movie": "The Return of the King "
 },
 {
   "id": 2369,
   "char": "PIPPIN",
   "dialog": "I don't know, I can't help it. ",
   "movie": "The Return of the King "
 },
 {
   "id": 2370,
   "char": "MERRY",
   "dialog": "You never can! ",
   "movie": "The Return of the King "
 },
 {
   "id": 2371,
   "char": "PIPPIN",
   "dialog": "I'm sorry alright? I won't do it again. ",
   "movie": "The Return of the King "
 },
 {
   "id": 2372,
   "char": "MERRY",
   "dialog": "Don't you understand? The enemy thinks you have the ring! He is going to     be looking for you Pip. They have to get you out of here. ",
   "movie": "The Return of the King "
 },
 {
   "id": 2373,
   "char": "PIPPIN",
   "dialog": "And you? You're coming with me? ,     Merry?  ",
   "movie": "The Return of the King "
 },
 {
   "id": 2374,
   "char": "MERRY",
   "dialog": "Come on! ",
   "movie": "The Return of the King "
 },
 {
   "id": 2375,
   "char": "PIPPIN",
   "dialog": "How far is Minas Tirith? ",
   "movie": "The Return of the King "
 },
 {
   "id": 2376,
   "char": "GANDALF",
   "dialog": "Three days ride as the Nazg'l flies. And you'd better hope we don't have     one of those on our tail. ",
   "movie": "The Return of the King "
 },
 {
   "id": 2377,
   "char": "MERRY",
   "dialog": "Here, something for the road.  ",
   "movie": "The Return of the King "
 },
 {
   "id": 2378,
   "char": "PIPPIN",
   "dialog": "The last of the Longbottom Leaf?  ",
   "movie": "The Return of the King "
 },
 {
   "id": 2379,
   "char": "MERRY",
   "dialog": "I know you've run out. You smoke too much Pippin. ",
   "movie": "The Return of the King "
 },
 {
   "id": 2380,
   "char": "PIPPIN",
   "dialog": "But, we'll see each other soon? ",
   "movie": "The Return of the King "
 },
 {
   "id": 2381,
   "char": "PIPPIN",
   "dialog": "Wont we? ",
   "movie": "The Return of the King "
 },
 {
   "id": 2382,
   "char": "MERRY",
   "dialog": "I don't know! I don't know whats going to happen. ",
   "movie": "The Return of the King "
 },
 {
   "id": 2383,
   "char": "PIPPIN",
   "dialog": "Merry?  ",
   "movie": "The Return of the King "
 },
 {
   "id": 2384,
   "char": "GANDALF",
   "dialog": "Run, Shadowfax show us the meaning of haste. ",
   "movie": "The Return of the King "
 },
 {
   "id": 2385,
   "char": "PIPPIN",
   "dialog": "Merry! ",
   "movie": "The Return of the King "
 },
 {
   "id": 2386,
   "char": "ARAGORN",
   "dialog": "Merry! ",
   "movie": "The Return of the King "
 },
 {
   "id": 2387,
   "char": "MERRY",
   "dialog": "He's always followed me everywhere I went since before we were tweens. I     would get him into the worst sort of trouble but I was always there to get     him out. Now he's gone. , Just     like Frodo and Sam. ",
   "movie": "The Return of the King "
 },
 {
   "id": 2388,
   "char": "ARAGORN",
   "dialog": "One thing I've learnt about Hobbits: They are a most hardy folk. ",
   "movie": "The Return of the King "
 },
 {
   "id": 2389,
   "char": "MERRY",
   "dialog": "Foolhardy maybe. He's a Took! ",
   "movie": "The Return of the King "
 }
]
